From beatnik to mod, from folkie to disco tart, from glam 
rocker to, most recently, crooner of American standards, 
Rod Stewart has had a remarkable musical journey. Alan Yentob 
visits Rod at his homes in Beverly Hills and Essex and talks 
to his friends and family, including all eight children aged 
from two years old to 50.

Featuring rare archival footage of Rod when he was barely out 
of his teens and living above his parents' north London 
sweetshop, lmagine examines an entertaining career across 
five musical decades

